<br>[アイアンクロススカル]スカジャン!!裏面は豹柄ベロア仕様!</b>
<br>
<br>Back Street Crawlerとは『裏道を這い回る奴ら』と言う意味★
<br>ロック、バイカー、ストリート等、不良テイストを忘れない大人に向けて発信する個性派ブランド！
<br>ブラック面はフロントスカルのウィングが腕の後ろまで伸びる特徴的で斬新なデザイン
<BR>
バックはスカルローズのクロス&大胆にフレアをあしらったロック＆タトゥアートデザイン!
<br>★裏面は豹柄ベロアのリバーシブルタイプ★
<br>
<br><b>■型番:BSJ-06
<br>
<br>■素材:最高級レーヨン100%
<br>
